import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import CameraIcon from '@mui/icons-material/PhotoCamera';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Link from '@mui/material/Link';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import {servicioPartida} from './servicios/ServicioPartida'


const theme = createTheme();

export default function Album() {
  const games = servicioPartida.crearSala();
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="relative">
        <Toolbar sx={{bgcolor: '#1B1D1F'}}>
          <Typography variant="h6" color="orange" noWrap>
            Sala del Misterio
          </Typography>
        </Toolbar>
      </AppBar>
      <main>
        <Container sx={{ py: 2, bgcolor: 'black' }} maxWidth="md">
          {/* End hero unit */}
          <Grid container spacing={4} >
            {games.map((game) => (
              <Grid item key={game} xs={12} sm={6} md={4}>
                <Card
                  sx={{ height: '100%', display: 'flex', flexDirection: 'column', bgcolor: 'orange'}} 
                >
                  <CardContent sx={{ flexGrow: 1 }}>
                    <Typography gutterBottom variant="h5" component="h2" >
                      {game.title}
                    </Typography>
                    <Typography>
                      Jugadores: {game.id}
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button 
                      size="small"
                      sx={{color: 'black'}}
                    >Unirse a la partida</Button>
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </main>
    </ThemeProvider>
  );
}
